css:
:root {
  font-size: 16px;
}
:root {
  font-size: 16px;
}
.merge-conflicts .conflict-list {
  max-height: 150px;
  overflow: scroll;
}
.merge-conflicts .navigate {
  cursor: pointer;
}
.merge-conflicts .navigate:hover {
  background-color: rgba(0, 150, 136, 0.1);
}
.merge-conflicts span.icon-fold {
  cursor: pointer;
}
.merge-conflicts span.icon-unfold {
  display: none;
  cursor: pointer;
}
.merge-conflicts.minimized span.icon-fold {
  display: none;
}
.merge-conflicts.minimized span.icon-unfold {
  display: inline-block;
}
.merge-conflicts-message {
  cursor: pointer;
}
.resolver.save-needed .save .text-success {
  display: none;
}
.resolver.save-needed .save .text-status {
  display: inline-block;
}
.resolver.save-needed .stage {
  display: none;
}
.resolver.stage-needed .stage .text-success {
  display: none;
}
.resolver.stage-needed .stage .text-status {
  display: inline-block;
}
.resolver .save .text-status {
  display: none;
}
.resolver .stage .text-success {
  display: none;
}
atom-overlay .side {
  padding: 0 20px;
  left: 0;
  right: 0;
}
atom-overlay .side span {
  margin-left: 10px;
}
atom-overlay .side span.pull-right {
  clear: right;
  margin-right: 20px;
}
atom-overlay .side button.revert {
  display: none;
}
atom-overlay .side.top {
  border-top-left-radius: 5px;
  border-top-right-radius: 5px;
}
atom-overlay .side.top button {
  margin-top: 1px;
}
atom-overlay .side.bottom {
  border-bottom-left-radius: 5px;
  border-bottom-right-radius: 5px;
}
atom-overlay .side.bottom button {
  margin-top: -1px;
}
atom-overlay .side.dirty {
  background-color: #ffeb3b;
}
atom-overlay .side.dirty button.revert {
  display: inline-block;
}
atom-overlay .navigation {
  padding: 0 20px;
  left: 0;
  right: 0;
  background: transparent;
}
atom-overlay .navigation span.pull-right {
  clear: right;
  margin-right: 20px;
}
atom-overlay .navigation button {
  margin-left: 5px;
  margin-top: -15px;
}
